import React, { Component } from 'react';
import ReactDom from 'react-dom';
import { Carousel, Item, Caption, Card, Col,Figure } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import tata_safari from './vehicles/tata_safari.jpeg';
import jeeto from './vehicles/mahindra_jeeto.jpeg';
import scorpio from './vehicles/mahindra_scorpio.jpeg';




//create class for nav
class Courasel_style extends Component {

    render() {

        return (<div>


            <Col lg={12}>
                <Card className="" bg="primary" >

                    <Carousel >

                        <Carousel.Item  >
                        <figure>
                            <img
                                className="d-block w-50 img-fluid"
                                src={jeeto}
                                alt="First slide"



                            /></figure>
                            <Carousel.Caption>
                                <h3>Jeeto</h3>

                            </Carousel.Caption>
                        </Carousel.Item>



                        <Carousel.Item >
                            <img
                                className="d-block w-50"
                                src={tata_safari}
                                alt="Third slide"

                            />

                            <Carousel.Caption>
                                <h3>tata_safari</h3>
                            </Carousel.Caption>
                        </Carousel.Item>
                        <Carousel.Item >
                            <img
                                className="d-block w-50"
                                src={scorpio}
                                alt="Third slide"
                            />

                            <Carousel.Caption>
                                <h3>corpio</h3>
                            </Carousel.Caption>
                        </Carousel.Item>
                    </Carousel>
                </Card></Col>

        </div>
        )
    }
}

export default Courasel_style;
